import React from 'react'
import './Card.css';
import Todo from './Todo';






function Card() {
  return (
    <div className="container">
    <Todo  title="Bangladesh" getDate={getDate}  getMonth={getMonth} getYear={getYear} description="very attractive Country" />
  </div>
  )
}

export default Card
